import * as React from "react";
import { CardProps } from "../types";

export const EducationCard: React.FC<CardProps> = ({ title, imageSrc }) => {
  return (
    <div className="flex flex-col grow shrink self-stretch my-auto w-[156px]">
      <div className="flex relative flex-col px-4 pt-36 pb-28 rounded-xl aspect-[0.65] w-[195px] max-md:px-5 max-md:pt-24 max-md:pb-28">
        <img
          loading="lazy"
          src={imageSrc}
          alt={`${title} education card`}
          className="object-cover absolute inset-0 size-full"
        />
        {title}
      </div>
    </div>
  );
};
